long_desc.thetext:
The scrolling of ThemedIframes (qx.ui.embed.ThemedIframe) does not work properly.
The bottom of the iframe can be reached by scrolling the scrollbars only the half way down - a further down movement of the scrollbars is possible, but has no effect because the bottom of the iframe is also reached.

This scrolling problem is illustrated by the attached image.

The reason for this bug is probably located in the Method ThemedIframe._onScrollbarY:
    _onScrollBarY : function(e) {
      this.scrollToY(e.getData());
    },
Example: The outer height of the IFrame is 400 pixels and the height of the content inside the IFrame is 600 pixels.
In this case, the scrollbar event "e.getData()" returns values that are in the range from 0..600. But the method this.scrollToY expects values that are in the range from 0..200.
The bug can probably fixed by adding a factor:
    _onScrollBarY : function(e) {
      this.scrollToY( e.getData() * 200/600 );
    },

A workaround for this issue is to use the base class Iframe instead of ThemedIframe which has scrollbars in the browser style.
